import { useState } from "react"

function Listitem() {

    const [todos, setTodos] = useState([
        {
            id: 1,
            text: "Nod JS",
            isCompleted: false
        },
        {
            id: 2,
            text: "Work",
            isCompleted: false

        },
        {
            id: 3,
            text: "Nod JS",
            isCompleted: false
        }
    ])
    return (
        <div>

            {todos.map((todo) => {
                return (

                    <div className="todo" key = {todo.id}>
                        <input type="checkbox" />
                        <div>{todo.text}</div>
                    </div>
                )
            })}
        </div>
    )
}
export default Listitem
